FeedPackage.ReleaseNotes:
1. Downgraded .NET Framework version from 4.5.2 to 4.5.1;
2. Added support of .NET Core 1.0.1;
3. Fixed a error #13 “HttpCompression Not Checking for Already Compressed Content”;
4. Fixed a error #14 “HttpCompression Algorithm Priority”.

1. Added support of .NET Core 1.0.3;
2. Downgraded .NET Framework version from 4.5.1 to 4.5;
3. In `IMarkupMinificationManager` interface was added a new property - `GenerateStatistics` (default `false`);
4. From `IHttpCompressionManager` interface was removed `IsSupportedMediaType` method;
5. In `IHttpCompressionManager` interface was added a new property - `SupportedMediaTypePredicate` (default `null`).

1. Added support of .NET Core 1.0.4;
2. In `IMarkupMinificationManager` and `IHttpCompressionManager` interfaces was added a new property - `SupportedHttpMethods` (default `GET`);
3. In `IHttpCompressionManager` interface was added two new properties - `IncludedPages` (default empty list) and `ExcludedPages` (default empty list).

1. Downgraded .NET Framework version from 4.5.2 to 4.5.1;
2. Added support of .NET Core 1.0.1;
3. Fixed a error #13 “HttpCompression Not Checking for Already Compressed Content”;
4. Fixed a error #14 “HttpCompression Algorithm Priority”;
5. Fixed a error #15 “Check for Content-Length in response headers”.

1. Added support of .NET Core 1.0.3;
2. In `MarkupMinificationOptionsBase` class was added a new property - `GenerateStatistics` (default `false`);
3. In `HttpCompressionOptions` class was added a new property - `SupportedMediaTypePredicate` (default `null`).

1. Added support of ASP.NET Core 1.0.4;
2. In `MarkupMinificationOptionsBase` and `HttpCompressionOptions` classes was added a new property - `SupportedHttpMethods` (default `GET`);
3. In `HttpCompressionOptions` class was added two new properties - `IncludedPages` (default empty list) and `ExcludedPages` (default empty list).

1. In 2-3 times has increased speed of the HTML and XHTML minification, and in 10-15 times speed of the XML minification;
2. In HTML/XHTML settings were added the following three properties: UseShortDoctype, UseMetaCharsetTag and RemoveJsProtocolFromAttributes;
3. In HTML settings the RemoveJsTypeAttributes and RemoveCssTypeAttributes properties now have default values equals to true, because they are now considered is safe;
4. In XML settings was added one new property - the CollapseTagsWithoutContent, and was renamed the RemoveComments property to RemoveXmlComments.

1. Fixed bug #6 «HtmlMinifier adds '=' to custom boolean attributes»;
2. Now in the HTML/XHTML Minifier during removing HTML comments are preserved AngularJS comment directives;
3. Now the `MinifyEmbeddedJsTemplates` configuration property also applies to the embedded AngularJS templates.

1. Added support of KnockoutJS, Kendo UI MVVM and AngularJS templates minification;
2. In HTML/XHTML settings were added the following 4 properties: `ProcessableScriptTypeList` (default is empty), `MinifyKnockoutBindingExpressions` (default `false`), `MinifyAngularBindingExpressions` (default `false`) and `CustomAngularDirectiveList` (default is empty);
3. Fixed bug #6 «HtmlMinifier adds '=' to custom boolean attributes»;
4. Fixed bug #9 «Error when compressing Knockout.js template section».

1. `rb` and `rtc` tags are now considered as optional end tags;
2. In configuration settings of HTML minifier was added one new property - `PreservableOptionalTagList` (default is empty);
3. Fixed a error #8 «MarkupMinificationException when having nested SVG element inside an SVG»;
4. Fixed a error #9 «<div>${{something}}</div> incorrectly minified».

1. Improved a safe whitespace minification mode;
2. `rb` and `rtc` tags are now considered as optional end tags;
3. In configuration settings of HTML minifier was added one new property - `PreservableOptionalTagList` (default is empty);
4. Fixed a error «MarkupMinificationException when having nested SVG element inside an SVG»;
5. Fixed a error «<div>${{something}}</div> incorrectly minified».

1. In configuration settings of HTML/XHTML minifier was changed type of `ProcessableScriptTypeCollection` and `CustomAngularDirectiveCollection` properties from `IEnumerable<string>` to `ISet<string>`;
2. In configuration settings of HTML minifier was changed type of `PreservableOptionalTagCollection` property from `IEnumerable<string>` to `ISet<string>`;
3. In configuration settings of HTML/XHTML minifier was changed a default value of `ProcessableScriptTypeList` property from "" to "text/html";
4. In `CrockfordJsMinifier` was optimized memory usage.

1. Added support of .NET Core 1.0.3;
2. Downgraded .NET Framework version from 4.5.1 to 4.5;
3. Fixed a error #31 “Perfomance is very slow when a HTML comment is inside a JavaScript block”;
4. Fixed a error in `SourceCodeNavigator` class.

1. Added support of the Microsoft Ajax Minifier version 4.92;
2. In configuration settings of CSS- and JS-minifier added 2 new properties: IgnoreAllErrors and LineBreakThreshold;
3. In configuration settings of JS-minifier added 7 new properties: ConstStatementsMozilla, ErrorIfNotInlineSafe, EvalLiteralExpressions, IgnorePreprocessorDefines, ManualRenamesProperties, QuoteObjectLiteralProperties and ReorderScopeDeclarations, and removed one property - MinifyCode.

1. Added support of the Microsoft Ajax Minifier version 5.14;
2. In the `CssColor` enumeration added new value - `NoSwap`;
3. In CSS minification settings changed the default value for `ColorNames` property (instead of `Strict` now is used `Hex`).

1. Added support of .NET Core 1.0.3;
2. Downgraded .NET Framework version from 4.5.1 to 4.5;
3. Added support of the NUglify version 1.5.5.
